// JavaScript version of the HTML structure

const root = document.createElement('div');
root.innerHTML = `
<header>
<footer class="footer">
    <p>&copy; 2025 Martin Tennis & Pickleball Academy. All rights reserved.</p>
</footer>`;

document.body.appendChild(root);
